import React from 'react';
import Basket from "./logo.js";
import { useSelector} from "react-redux";
import BasketImg from "./basket.svg";


function Cart () {
  
    const cart = useSelector((store) => store.cart);
    return (
            <div className="logoBasket" >
               
                 <BasketImg />
                    {Basket.map((item) => (                       
                    <img src={item.basketNumber} className="logoBasketNumber"  />
                     
                )
                )}
            
            </div>         
       
    )
}

export default Cart
